import React from 'react'
import SideBar from '../SideBar';
import Chat from "../Chat";

import AppBodyStyled from './AppBodyStyled';
import ChatInput from '../ChatInput';

function AppBody() {
    return (
        <AppBodyStyled>
             <SideBar />
             <Chat />
             <ChatInput/>
        </AppBodyStyled>
    )
}

export default AppBody;
